import React from "react";

const Login = () => {
    return (
        <> <div className="container-fluid nav-bg">
            <div className="row">
                <div className="col-11 mx-auto">
                    <div className=" row d-flex justify-content-center text-center mt-aut">
                        <h1>hello login</h1>
                    </div>
                </div>
            </div>
        </div>
        </>
    )
}
export default Login;
